import React from "react";
import IndividualData from './individualdata'

 const Data =({exelData})=>{
  return  exelData.map((individualExcelData)=>(
      <tr key={individualExcelData.Id}>
          <IndividualData individualExcelData={individualExcelData}/>
      </tr>

  ))
}
export default Data
